import React from 'react';
import Hero from '../components/Hero';
import ServiceCard from '../components/ServiceCard';
import Clients from '../components/clients';

const Home = () => {
  return (
    <div>
      <Hero />
      <div className="container py-5">
        <h2 className="text-center mb-4">Our Services</h2>
        <div className="row">
          <ServiceCard title="Videography" description="Professional video services for events, conferences, and personal occasions." />
          <ServiceCard title="Photography" description="Capturing timeless memories with expert photography for all occasions." />
          <ServiceCard title="Web Services" description="Complete web development, hosting, and digital solutions for your business." />
        </div>
      </div>
      <Clients />
    </div>
  );
};

export default Home;
